  return (
    <div> 
      Icon made from <a href="http://www.onlinewebfonts.com/icon">Icon Fonts</a> is licensed by CC BY 3.0
      <img className="newDayPic" src="frontend/src/assets/newdaypost.png">Today</img>
    </div>
  )
}
